import React from 'react'


class Product extends React.Component {
render() {
const {id, img, title, price} = this.props
  return (
    <div className='product' id={id}>
        <img src={img} alt="item" />
        <div className="caption">
            <p> { title } </p>
            <p> { price } </p>
        </div>
    </div>
  )
}
}

export default Product
